export default function Header(props) {
    return (
        <nav className="nav">
            <div className="header">
                <img src="profilepic.jpg" className="profilepic" />
                <h1>William Gustafsson</h1>
            </div>
            <div className="language-div">
                <button className="language-button" onClick={props.toggleLanguage}><span class="fi fi-us"></span></button>
            </div>
        </nav>
    )
}
